import React, { PureComponent } from 'react';
import { saveAs } from "file-saver";
import { dataService } from '../services/dataService';
import UploadFile from './uploadFile';
import LogOut from './LogOut';
import LogInPage from './login';
import '../myStyle.css';
var jwt = require('jsonwebtoken');

class HomePage extends PureComponent {


    constructor(props) {
        super(props)
        const sessionToken = sessionStorage.getItem("token")
        this.state = {
            admin: false,
            disp_user: [],
            user_data: undefined,
            description: ""
        }
        this.set_description = this.set_description.bind(this)
        this.user_table = this.user_table.bind(this)
    }
    set_description(d) {
        this.setState({
            description: d
        })
    }
    admin_table(user,user_admin) {
        var boll = false;
        if(user_admin == true)
            boll = true;
            dataService.getUserData(user,boll)
            .then(json => {
                console.log(json);
                if (Array.isArray(json)) {
                    this.setState({
                        disp_user: json
                    });
                }
            })
            .catch(e => {
                console.log(e);
            });
    }
    user_table(user) {
        dataService.getUserData(user,true)
            .then(json => {
                console.log(json);
                if (Array.isArray(json)) {
                    this.setState({
                        disp_user: json
                    });
                }
            })
            .catch(e => {
                console.log(e);
            });
    }
    componentDidMount() {
        var t = sessionStorage.getItem("token");
        try {
          const payload = this.verifier.verify(t);
        } catch {
          console.log("Invalid token");
        }
        var decoded = jwt.decode(t);
        var decoded = jwt.decode(t, { complete: true });
        const userObj = decoded.payload;
        this.setState({
            user_data: userObj
        })
        setTimeout(()=> {
            if(this.state.user_data.email=="2712aabbccdd@gmail.com"){
                this.state.admin = true;
            }
            if (this.state.admin){
                this.user_data(this.state.user_data.email,this.state.admin)
            } else {
                this.admin_table(this.state.user_data.email,this.state.admin);
            }
        }, 250);
        dataService.getUser()
    }

    onClickDownLoad(file) {
        window.open("https://dfbiaa0nywvvp.cloudfront.net/" + file);
        saveAs("https://dfbiaa0nywvvp.cloudfront.net/"+file, file );
    }

    onClickDelete(fileName, id) {
        dataService.deleteFile(fileName, id)
            .then(json => {
                console.log(json);
                setTimeout(()=> {
                if (this.state.admin){
                    this.user_table()
                } else {
                    this.admin_table(this.state.user_data.email);
                }
            }, 250);

            })
            .catch(e => {
                console.log(e);
            });
    }

    render() {
        const { admin } = this.state;
        return (
            <center>
                <div>
                    <p> User: { this.state.user_data && <a href="#login">{this.state.user_data.email}</a> }
                    &nbsp;&nbsp;
                    User Type:  { admin && <a> "ADMIN" </a> }
                                { !admin && <a> "Non Admin"</a> }
                    {this.state.user_data && <LogOut class='topright'></LogOut>}
                    {!this.state.user_data && <LogInPage></LogInPage>}</p>
                    { this.state.user_data &&
                        <UploadFile
                            user={this.state.user_data.email}
                            description={this.state.description}
                            refreshList={e => this.user_table()}
                            refreshList2={e => this.admin_table(e)}
                            admin={admin} >
                        </UploadFile>
                    }
                    &nbsp; &nbsp;
                    <div>
                        <table>
                            <tr key={0}>
                                { admin && <th>User</th> }
                                <th>File Name</th>
                                <th>Description</th>
                                <th>File Upload Time</th>
                                <th>File Updated Time</th>
                                {!admin && <th>Download</th>}
                                <th>Delete</th>
                            </tr>
                            { this.state.disp_user.map(ele => {
                                return (
                                    <tr key={ele.id}>
                                        { admin && <td>{ele.userName}</td> }
                                        <td>{ele.fileName}</td>
                                        <td>{ele.description}</td>
                                        <td>{ele.fileCreatedTime}</td>
                                        <td>{ele.fileUpdatedTime}</td>
                                        { !admin &&
                                            <td><a href={"https://dfbiaa0nywvvp.cloudfront.net/" + ele.fileName} target="_blank" download={ele.fileName}>
                                                <button class="download_button" onClick={event => this.onClickDownLoad(ele.fileName)}>
                                                    DownLoad
                                                </button>
                                            </a></td>
                                        }
                                        <td><button class="delete_button" onClick={event => this.onClickDelete(ele.fileName, ele.id)}>
                                            Delete
                                        </button></td>
                                    </tr>
                                );})
                            }
                        </table>
                    </div>
                </div>
            </center>
        )
    }
}

export default HomePage
